            <p>Status: {robot.status}</p>
            <p>Battery Level: {robot.batteryLevel}%</p>
            <p>Temperature: {robot.temperature}Â°C</p>
            <p>Humidity: {robot.humidity}%</p>
            <p>Pressure: {robot.pressure}Pa</p>
            <p>Last Task: {robot.lastTask}</p>
            <p>Task Progress: {robot.taskProgress}%</p>
            <img src={robot.cameraFeed} alt="Robot Camera Feed" />
        </div>

    );
}

